import React from 'react'
import './Footer.css'

const GetDate = () => {
    let date = new Date()
    return date.getFullYear()
}

const Footer = (props) => {
    return (
        <footer>
            Todos os direitos reservados - {GetDate()}
        </footer>
    )
}

export default Footer;
